var app=angular.module("nsds",[]);app.controller("PoolsController",function(n,e){e.get("api/pools").then(function(e){n.pools=e.data})}),app.controller("ClientsController",function(n,e){e.get("api/clients/").then(function(e){n.pools=_.groupBy(e.data,function(n){return n.poolId}),n.clients=_.each(e.data,function(n){n.status=function(){return"ok"}})})}),app.controller("PackagesController",function(n,e){n.deploy=function(n){n.isDeploying=!0;var o=document.getElementById(n.$$hashKey.replace(":","_")),t=new Spinner({lines:9,length:5,width:3,radius:5,scale:1,corners:1,color:"#ccc",opacity:.05,rotate:0,direction:1,speed:.7,trail:75,fps:20,zIndex:2e9,className:"spinner",top:"50%",left:"50%",shadow:!1,hwaccel:!1,position:"relative"}).spin(o);e.get("/api/deploy/package/"+n.deployment.name+"/"+n.name).then(function(e){n.isDeploying=!1,t.stop()})},e.get("api/packages").then(function(e){n.packages=_.each(e.data,function(n){n.isDeploying=!1})})});